import React from 'react';

function ProfileHeader(props) {
  const { profile } = props;

  if (profile.length === 0) {
    return null;
  } else if (profile.private === true) {
    return <h1>This profile is private</h1>;

  } else {
    return (
      <div className="profileHeader">
        <h1>{profile.name}</h1>
        <img src={profile.icon} alt="player icon" />
        <h2>{profile.gamesWon} Games Won</h2>
        <p>{profile.level}</p>
        <img src={profile.levelIcon} alt="level icon" />
        <img src={profile.prestigeIcon} alt="prestige icon" />
        <p>{profile.endorsement}</p>
        <img src={profile.endorsementIcon} alt="endorsement icon" />
        {profile.ratings.map(data => (
          <div key={data.index}>
            <img src={data.roleIcon} alt="role icon" />
            <img src={data.rankIcon} alt="rank icon" />
            <p>{data.level}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default ProfileHeader;
